// Parse Gemini JSON output
const text = $input.first().json.content.parts[0].text;
let result = {};

try {
  const cleanText = text.replace(/```json/g, '').replace(/```/g, '').trim();
  result = JSON.parse(cleanText);
} catch (e) {
  result = {
    status: "NORMAL",
    reason: "AI parse error, assuming normal.",
    email_subject: "Morning Update",
    email_body: "Good morning. AI couldn't parse the data, but here is your alarm."
  };
}

return result;
